import React from "react";
import InlineEdit from "./InlineEdit";

const priorityColor = { 'Haute': 'red', 'Moyenne': 'orange', 'Basse': 'green' };

function ContactBoard({ contacts, onAdd, onUpdate, onDelete, users = [] }) {
  // --- AJOUT ---
  const addContact = () => {
    const name = prompt("Nom du contact ?");
    if (name) {
      onAdd({
        name,
        type: 'Organisation', // ou 'Personnalité'
        priority: 'Basse',
        status: 'À contacter',
        notes: '',
        assignedTo: null,
      });
    }
  };

  // --- MODIF ---
  const updateContact = (id, field, value) => {
    const c = contacts.find(c => c.id === id);
    if (!c) return;
    onUpdate(id, { ...c, [field]: value });
  };

  // --- SUPPRESSION ---
  const removeContact = (id) => {
    if (window.confirm("Supprimer ce contact ?")) {
      onDelete(id);
    }
  };

  return (
    <div>
      <h2>Contacts</h2>
      <button onClick={addContact}>Ajouter un contact</button>
      <ul>
        {contacts.map(c => (
          <li key={c.id} style={{ border: "1px solid #ddd", margin: 8, padding: 8 }}>
            <b>
              <InlineEdit
                value={c.name}
                onSave={val => updateContact(c.id, "name", val)}
              />
            </b> (
            <InlineEdit
              value={c.type}
              onSave={val => updateContact(c.id, "type", val)}
            />
            )
            <span style={{
              color: priorityColor[c.priority],
              fontWeight: 'bold',
              marginLeft: 10
            }}>
              <select
                value={c.priority}
                onChange={e => updateContact(c.id, "priority", e.target.value)}
                style={{ marginLeft: 5, color: priorityColor[c.priority], fontWeight: "bold" }}
              >
                <option>Haute</option>
                <option>Moyenne</option>
                <option>Basse</option>
              </select>
            </span>
            <br />
            Statut :
            <select
              value={c.status}
              onChange={e => updateContact(c.id, "status", e.target.value)}
              style={{ marginLeft: 5 }}
            >
              <option>À contacter</option>
              <option>En contact</option>
              <option>En attente</option>
              <option>Terminé</option>
            </select>
            <br />
            Assigné à :
            <select
              value={c.assignedTo || ""}
              onChange={e => updateContact(c.id, "assignedTo", e.target.value ? Number(e.target.value) : null)}
              style={{ marginLeft: 5 }}
            >
              <option value="">Non assigné</option>
              {users.map(u =>
                <option key={u.id} value={u.id}>{u.username}</option>
              )}
            </select>
            <br />
            Notes :
            <InlineEdit
              value={c.notes}
              onSave={val => updateContact(c.id, "notes", val)}
              type="textarea"
              style={{ width: "95%", minHeight: 30 }}
            />
            <br />
            <button onClick={() => removeContact(c.id)} style={{ color: "red" }}>Supprimer</button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ContactBoard;
